Redécouvrez les endroits que vous avez visités en explorant vos photos qui comportent des données de localisation, y compris les photos partagées que vous avez enregistrées. Votre carte utilise des informations de l'emplacement telles que :

 • le GPS de votre appareil photo;
 • des points de repère détectés.

Les photos et les vidéos du dossier verrouillé qui ne sont pas sauvegardées ne seront pas conservées si vous :

 • changez d'appareil;
 • rétablissez les paramètres par défaut de cet appareil;
 • supprimez l'application Google Photos.
